import {useState, useEffect} from 'react'
import ExamCard from './ExamCard'
import axios from 'axios'
import { useParams } from 'react-router-dom';


const ListExams = () => {

    const api = "http://localhost:8088/api/v1/examResult/trainee";
    const [examResult, setExamResults] = useState([])

    const params = useParams;

    useEffect(() => {
        loadExamResults();
    }, [])

    const loadExamResults = () => {
        console.log("THE ID USING PARAMS IS: " + params.trainee_id)
        axios.get(api + '/' + params.trainee_id)
                .then(response => {setExamResults(response.data)})
                .catch(error => console.log('unable to load data'))
    }

    return(
        <div>
            <h1> Exam Results </h1>
            {
                examResult.map(
                    examResult => <ExamCard key={examResult.trainee.name} examResult={examResult}/>
                )
            }
           
        </div>
    )
}

export default ListExams
